import React, { useState } from "react";

export const Register = (props) => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [date, setDate] = useState('');

    const handleSubmit = (e) => {
            e.preventDefault();
            console.log(username);
            console.log(password);
            console.log(date);
        }

    return (
        <>
            <form onSubmit={handleSubmit}>
                <label htmlFor="date">Cohort Start Date: </label>
                    <input value={date} name="date" id="date" placeholder="Enter your start date:" />
                <label htmlFor="username">Username: </label>
                    <input value={username} onChange={(e) => setUsername(e.target.value)}
                        type="username" placeholder="Enter your username" id="username" name="username" />
                <label htmlFor="password">Password: </label>
                    <input value={password} onChange={(e) => setPassword(e.target.value)}
                        type="password" placeholder="Enter your password" id="password" name="password" />
                <button type="submit">Register</button>
            </form>
            <button onClick={() => props.onFormSwitch}>Already have an account? Login here.</button>
        </>
    )
}
